import logo from './logo.svg';
import './App.css';
import Home from './layout/Home';
import { BrowserRouter,Route } from 'react-router-dom'
import Register from './authetification/Register';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Home />
<Route path="/Register" >
<Register />

</Route>
<Route path="" >
<Register />

</Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
